"use client";

import { useEffect, useState } from "react";
import SensorCard from "./SensorCard";
import SensorChart from "./SensorChart";
import { SensorData } from "@/model/sensor"

export default function Dashboard() {
  const [sensor, setSensor] = useState<SensorData | null>(null);
  const [historyyyy, setHistory] = useState<SensorData[]>([]);

  const picture = ``

 useEffect(() => {
    const interval = setInterval(() => {
      const newSensor: SensorData = {
        time: new Date().toISOString(),
        flame: Math.random() * 100,
        light: Math.random() * 100,
        vibration: Math.random() * 10,
        air: Math.random() * 200,
        human: Math.round(Math.random()),
        cameraImage: picture,
      };

      setSensor(newSensor);

      // update history   20 
      setHistory((prev) => {
        const newHistory = [...prev, newSensor];
        if (newHistory.length > 20) newHistory.shift(); // limit array length
        return newHistory;
      });
    }, 1000);

    return () => clearInterval(interval);
  }, []);


  if (!sensor) return <div className="p-6">Connecting...</div>;

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-semibold mb-6 text-black">Embedded Dashboard</h1>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        <SensorCard title="Flame" value={sensor.flame} />
        <SensorCard title="Light" value={sensor.light} />
        <SensorCard title="Vibration" value={sensor.vibration} />
        <SensorCard title="Air Quality" value={sensor.air} />
        <SensorCard title="Human Detect" value={sensor.human} />
        <SensorCard title="Time" value={new Date(sensor.time).toLocaleString()} />
      </div>

      <div className="flex items-start justify-between mt-6">
        {/* Camera */}
          {sensor.cameraImage && (
            <div className="mt-6">
              <h2 className="text-xl font-semibold mb-2 text-black">Camera</h2>
              <img
                src={`data:image/png;base64,${sensor.cameraImage}`}
                className="rounded shadow w-72"
              />
            </div>
          )}

        {/* Button */}
          <button
            className="bg-blue-500 text-white px-4 py-2 rounded shadow hover:bg-blue-700 transition-colors duration-200 flex"
            onClick={async () => {
              try {
                await fetch("/api/alarm", {
                  method: "POST",
                });
                console.log("Alarm triggered!");
              } catch (err) {
                console.error(err);
              }
            }}
          >
            Trigger Alarm 
          </button>
    </div>


      {/* Graph */}
      <div className="mt-10">
        <h2 className="text-xl font-semibold mb-2 text-black">Flame Sensor Graph</h2>
        <SensorChart data={historyyyy} dataKey="flame" />
      </div>
    </div>
  );
}
